import PropTypes from 'prop-types';
import stat from './Statistics.module.css';

export default function Statistics ({ good, neutral, bad, total, positiveFeedbackPercentage}) {
 return (
    <ul className={stat.list}>
        <li className={stat.item}>Good: {good}</li>
        <li className={stat.item}>Neutral: {neutral}</li>
        <li className={stat.item}>Bad: {bad}</li>
        <li className={stat.item}>Total: {total}</li>
        <li className={stat.item}>Positive feedback: {positiveFeedbackPercentage}%</li>
    </ul>
 ) 
};
